    return (
      <div className="chatroom">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col penerima">
                <p className="">
                  Kasih aku nasihat kawan agar aku menjadi pribadi yang lebih
                  baik
                </p>
              </div>
            </div>
            <div className="row">
            <div className="col">
                <p className="pengirim">
                  Waktu lebih berharga daripada emas kawan,maka jangan sia2kan
                  waktu sedikitpun
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ChatRoom;
